import {} from "react";
import { Pressable, StyleSheet } from "react-native";
import { RootStackScreenProps } from "../../types";
import { Text } from "./Themed";

export default function VerifyPhoneFormat(
  phone: any,
  navigation: RootStackScreenProps<"Register">
) {
  function Verify() {
    console.log(phone);
  }

  return (
    <Pressable
      style={[styles.button, { opacity: !phone ? 0.5 : 1 }]}
      onPress={() => Verify()}>
      <Text>Continue</Text>
    </Pressable>
  );
}

const styles = StyleSheet.create({
  button: {
    backgroundColor: "#2f95dc",
    paddingVertical: 10,
    paddingHorizontal: 20,
    position: "absolute",
    borderRadius: 100,
    bottom: 20,
  },
});
